import React, {useState} from 'react';
import {toast} from "react-toastify";
import ProductItem from "./ProductItem";
import {Link} from "react-router-dom";
import AddProductPage from "./CategoryPages/AddProductPage";

const AdminPage = () => {

    return (
        <div>
            <button className="btn btn-primary"><Link to={<AddProductPage/>}>Add new product</Link></button>
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Category</th>
                        <th>Price</th>
                        <th>Quantity</th>
                        <th>Image</th>
                        <th>Update</th>
                        <th>Action</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td><ProductItem/></td>
                    </tr>
                </tbody>

                

            </table>
        </div>
    );
};

export default AdminPage;
